import React from 'react';
import {
    Carousel,
    CarouselItem,
    CarouselControl,
    CarouselIndicators,
    CarouselCaption 
} from 'reactstrap';

const items = [
    {
        caption: "Crosspad",
        tech: ['JavaScript', 'SCSS', 'React','Jest', 'React-Testing-Library'],
        summary: 'Look up videogame review trends.',
        img: 'data:image/jpeg;base64,'
    },
    {
        caption: "Marvelous Bookworm",
        tech: ['JavaScript', 'CSS', 'jQuery', 'NodeJS', 'Express'],
        summary: 'Look up comic books',
        img: 'data:image/jpeg;base64,'
    },
    {
        caption: "Grab Dat Cat",
        tech: ['JavaScript', 'SCSS', 'React'],
        summary: 'Find a furry friend',
        img: 'data:image/jpeg;base64,'
    }
]



class Projects extends React.Component {

    state ={
        activeIndex: 0
    };

   

    render() {

        const onExiting = () => {
            this.animating = true;
          }
        
          const onExited = ()=> {
            this.animating = false;
          }
        
         const next = ()=> {
            if (this.animating) return;
            const nextIndex = this.state.activeIndex === items.length - 1 ? 0 : this.state.activeIndex + 1;
            this.setState({ activeIndex: nextIndex });
          }
        
         const previous = () => {
            if (this.animating) return;
            const nextIndex = this.state.activeIndex === 0 ? items.length - 1 : this.state.activeIndex - 1;
            this.setState({ activeIndex: nextIndex });
          }
        
         const goToIndex = (newIndex) => {
            if (this.animating) return;
            this.setState({ activeIndex: newIndex });
          }

        const {activeIndex} = this.state;
        const slides = items.map((item, index)=>{
            console.log(item);
            return (
                <CarouselItem
                    onExiting={onExiting}
                    onExited={onExited}
                    key={index}
                >
                    <img src={item.img} alt='' />
                    <CarouselCaption captionText={item.summary} captionHeader={item.caption} />
                </CarouselItem>
            )
        });
        return (
            
                <Carousel
                    activeIndex={activeIndex}
                    next={next}
                    previous={previous}
                >
                    <CarouselIndicators items={items} activeIndex={activeIndex} onClickHandler={goToIndex} />
                        {slides}
                    <CarouselControl direction="prev" directionText="Previous" onClickHandler={previous} />
                    <CarouselControl direction="next" directionText="Next" onClickHandler={next} />
                </Carousel>
            
        )
    }
}

export default Projects;